import React, { PureComponent } from 'react';

import $ from "jquery";
import "../../../node_modules/bootstrap/dist/js/bootstrap.min.js";
import "../../../node_modules/metismenu/dist/metisMenu.min.js";

import "../../../node_modules/jquery.flot/excanvas.min.js";
import "../../../node_modules/jquery.flot/jquery.flot.js";
import "../../../node_modules/jquery.flot/jquery.flot.pie.js";
import "../../../node_modules/jquery.flot/jquery.flot.resize.js";
import "../../../node_modules/jquery.flot/jquery.flot.time.js";
import "../../../node_modules/jquery.flot.tooltip/js/jquery.flot.tooltip";

import "../../../node_modules/raphael/raphael.min.js";
import "../../../node_modules/morris-js-module/morris.js";


import "../../../node_modules/datatables/media/js/jquery.dataTables.min.js";
import "../../../node_modules/datatables-bootstrap/js/dataTables.bootstrap.min.js";
import "../../../node_modules/datatables.net-responsive/js/dataTables.responsive.min.js";




class Script extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    componentDidMount() {
        // Datatables
        $(document).ready(function() {
            $('#dataTables-example').DataTable({
                responsive: true
            });
        });

        // tooltip demo
        $('.tooltip-demo').tooltip({
            selector: "[data-toggle=tooltip]",
            container: "body"
        })
        // popover demo
        $("[data-toggle=popover]").popover()
    }
    render() { 
        return ( 
            null
         );
    }
}

export default Script;
